import React from 'react';

const CountryFlag = ({ country }) => {
  const images = [];

  if (country.toLowerCase().includes('usa')) {
    images.push(<img key={'usa'} src={`https://flags.fmcdn.net/data/flags/mini/us.png`} style={{marginRight: '4px'}}/>);
  }

  if (country.toLowerCase().includes('uk')) {
    images.push(<img key={'gb'} src={`https://flags.fmcdn.net/data/flags/mini/gb.png`}  style={{marginRight: '4px'}}/>);
  }

  return <>{images}</>;
};

export default CountryFlag;
